    return (
      <div className="mainChild">
        <h3>Últimas informações</h3>
        </div>
      );
  }

  getView = () => {
    switch(this.props.view) {
      case "Home":
        return this.getHome();
        break;
      default:
        return this.getHome();
    }
  }

  render() {
    let content = this.getView;
